MongoDB compare sub arrays<p>I try to check for discrepancies in our database, and for that I need to compare 2 arrays within the same element.</p>
<p>I'm not far but when comparing arrays with <code>.match({$expr: {$ne: ...})</code>, the order matters. So I would need to reorder those arrays to compare them.</p>
<p>My script currently looks like that:</p>
<pre><code>db.users.aggregate()
    .match({&quot;companies&quot;: { $exists: true, $not: {$size: 0} }})
    .lookup({
        from: &quot;companies&quot;,localField: &quot;_id&quot;, foreignField: &quot;users.userId&quot;, as: &quot;relatedCompanies&quot;
    })
    .addFields({
        relatedCompanyIds: {
            $map: {
                input: &quot;$relatedCompanies&quot;,
                as: &quot;relatedCompanyId&quot;,
                in: &quot;$$relatedCompanyId._id&quot;
            },
        },

    })
    .match({$expr:{$ne:[&quot;$relatedCompanyIds&quot;, &quot;$companyIds&quot;]}})
</code></pre>
<p>Basically, each collection element contains an array <code>companyIds</code> and another array <code>relatedCompanyIds</code>, which are both a list of <em>ObjectIDs</em>.</p>
<p>Any idea about how to sort those arrays, or to compare two arrays within the same item without caring about the order?</p>

