<p>I have this kind of collection:</p>
<pre><code>[
  {
    &quot;Id&quot;: 1,
    &quot;extension&quot;: [
      {
        &quot;key&quot;: &quot;Name&quot;,
        &quot;value&quot;: &quot;Bob&quot;
      },
      {
        &quot;key&quot;: &quot;Age&quot;,
        &quot;value&quot;: 20
      }
    ]
  },
  {
    &quot;Id&quot;: 2,
    &quot;extension&quot;: [
      {
        &quot;key&quot;: &quot;Name&quot;,
        &quot;value&quot;: &quot;Sam&quot;
      }
    ]
  },
  {
    &quot;Id&quot;: 3,
    &quot;extension&quot;: [
      {
        &quot;key&quot;: &quot;Age&quot;,
        &quot;value&quot;: 25
      }
    ]
  },
  {
    &quot;Id&quot;: 4
  }
]
</code></pre>
<p>I want to update my collection so that every document ends with an <code>extension</code> array that contains an item with Key <code>Name</code> and also an item with Key <code>Age</code>.</p>
<p>There are 4 types of existing documents in my collection:</p>
<ul>
<li>A document missing the <code>extension</code> property altogether. For these, I want to create the <code>extension</code> array and insert 2 items. One with key <code>Name</code> and value &quot;Default&quot; and another item with key <code>Age</code> and value 99.</li>
<li>A document missing an item with key <code>Name</code> in its <code>extension</code> array. I want to insert an item with key <code>Name</code> and value &quot;Default&quot;.</li>
<li>A document missing an item with key <code>Age</code> in its <code>extension</code> array. I want to insert an item with key <code>Age</code> and value 99.</li>
<li>A document that already has an item with a key <code>Name</code> and an item with a key <code>Age</code> in its extension array. I don't want to update these.</li>
</ul>
<p>I want to use aggregation pipeline to update my collection, but I am not sure what to use as the query and as the update commands to achieve that.</p>
<p>I think I need something like that:</p>
<pre><code>{
    update: &quot;MyCollection&quot;,
    updates: [
        {
            q: { xxxxxxxxxx },
            u: [ 
                    extensions: {
                        yyyyyyyyyyyyyy
                    }
                ],
            multi: true
        }
    ]
}
</code></pre>
