      {
        &quot;key&quot;: &quot;Name&quot;,
        &quot;value&quot;: &quot;Sam&quot;
      },
      {
        &quot;key&quot;: &quot;Age&quot;,
        &quot;value&quot;: 99
      }
    ]
  },
  {
    &quot;Id&quot;: 3,
    &quot;extension&quot;: [
      {
        &quot;key&quot;: &quot;Name&quot;,
        &quot;value&quot;: &quot;Default&quot;
      },
      {
        &quot;key&quot;: &quot;Age&quot;,
        &quot;value&quot;: 25
      }
