<pre><code>{
   id: my_id
   inner_foo : [
      {
         inner_id : id_A
         inner_field : field_A
      },
      {
         inner_id : id_B
         inner_field : field_B
      }
   ]
}
</code></pre>
<p>When receiving a request, i got two ids, the <code>id</code> one (here <code>my_id</code>), and the <code>inner_id</code> one (here for example <code>id_A</code>).
