Jest + Mongoose: Have to run find twice to get results<p>I am building tests for my node/express controller methods and using <code>@shelf/jest-mongodb</code>. I am creating a document first, and then when I try to find that I have to run find twice from model in order to get the results. It should get the results in the first find instead.</p>
<p><strong>test.js</strong></p>
<pre><code>const { Subscription } = require('../src/models/subscription.schemaModel'); // model
const {
  createSubscription,
} = require('../src/controllers/subscription.controller');

const subData = {...};

beforeAll(async () =&gt; {
  await mongoose.connect(

    process.env.MONGO_URL,
    { useNewUrlParser: true, useUnifiedTopology: true },
    (err) =&gt; {
      if (err) {
        console.error(err);
        process.exit(1);
      }
    }
  );
});

afterAll(async () =&gt; {
  await mongoose.connection.close();
});

describe('creates a subscription ', () =&gt; {
  it('can be created correctly', async () =&gt; {
    const sub = await createSubscription(subData);
    await Subscription.find(); // if I comment out this line, I would get 0 results.
    const subs = await Subscription.find();
    expect(subs[0].items[0].sku).toBe(233234);
  });
});
</code></pre>
<p><strong>subscription.controller.js</strong></p>
<pre><code>const Mongoose = require('mongoose');
const { Subscription } = require('../models/subscription.schemaModel');
const isTestEnv = process.env.NODE_ENV === 'test';

module.exports.createSubscription = async (data) =&gt; {
  try {
    let error = null;
    const doc = new Subscription(data);
    doc.accountId = Mongoose.Types.ObjectId(doc.accountId);

    await doc.save(function (err) {
      if (err) {
        logger.error(`createSubscription saving ${err}`);
        error = err;
      }
    });

    if (!error) {
      logger.info(
        `Subscription created =&gt;  id: ${doc._id} store: ${doc.store}`
      );
      return doc;
    } else {
      return error;
    }
  } catch (err) {
    logger.error(`createSubscription ${err}`);
  }
};
</code></pre>
<p>The <strong>schemaModel</strong> file essentially contains the schema and exports model. Everything seems to work fine if I would do all the operations in the test file (schema+model+controller module)which defeats the purpose of testing my modules but not if I am importing. In this case I would have to run <code>find()</code> twice to get the results.</p>
<p>I have been trying multiple things from what I could find from googling, but no luck! Any help or lead would be appreciated. Also let me know if you need any other details.
Thank you!!</p>

