mongodb - using $geoNear gives "geo near accepts just one argument when querying for a GeoJSON point" when using maxDistance<p>This appears to be a common error but I can't seem to make it work with all the suggestions I've seen. This is my setup:</p>
<pre><code>// point.js (based on mongoose recommended subdocument pattern for reusing the GeoJSON definition
// see here https://mongoosejs.com/docs/geojson.html)
