const pointSchema = new mongoose.Schema({
    type: {
        type: String,
        enum: ['Point'],
        required: true
    },
    coordinates: {
        type: [Number],
        required: true,
    }
});

exports = pointSchema;
</code></pre>
<pre><code>// user.js
var schema = new Schema({
  location: {
    type: pointSchema,
  },
  ...
});

schema.index({ location: '2dsphere' });
var User = mongoose.model('User', schema);
</code></pre>
<pre><code>// routeHandler.js
          const near = { type: 'Point', coordinates: [lng, lat] };
          User.aggregate([
            { $geoNear: {
              near,
              distanceField: 'dist',
              maxDistance: 100000,
              spherical: true,
            } },
            ...
          ]).exec((err, results) =&gt; {
            console.log('error or results:', err, results);
          });
</code></pre>
<p>And I get this error:</p>
<blockquote>
<p>MongoError: Failed to determine whether query system can provide a covered projection :: caused by :: geo near
accepts just one argument when querying for a GeoJSON point. Extra field found: $maxDistance: 100000.0</p>
</blockquote>
<p>Most of the threads I've seen suggest that it's an issue with indexing, but you can see in <code>user.js</code> that I'm directly calling</p>
<pre><code>schema.index({ location: '2dsphere' });
</code></pre>
<p>without any luck.</p>
<p>I'd really appreciate any suggestions, thanks!</p>

