<pre><code>{
  &quot;_id&quot;: ObjectID('123'),
  &quot;test&quot;: {
     &quot;a&quot;:1,
      &quot;b&quot;:1
   }
},
{
  &quot;_id&quot;: ObjectID('456'),
  &quot;test&quot;: {
     &quot;a&quot;:1
   }
</code></pre>
<p>Now I want those result whose &quot;test&quot; field has property other than &quot;a&quot; or in another way, I want those objects which have multiple keys/properties in a &quot;test&quot; field or to check the size of an object greater than 1</p>
<p>So, the result will be:</p>
<pre><code>{
   &quot;_id&quot;: ObjectID('123'),
   &quot;test&quot;: {
      &quot;a&quot;:1,
       &quot;b&quot;:1
