Grails with MongoDB - how to define nested and reusable fields<p>I'm trying to rewrite my node.js + express backend in grails. I'm using a MongoDB database, where it is common to nest fields. In my current backend I have defined a schema (using mongoose), with a field such as:</p>
<pre><code>normalized: {
    full_name: {type: String, trim: true, index: true}
},
</code></pre>
<p>I have also defined a separate, reusable schema called &quot;locationSchema&quot; that I can use for many of my fields, like so:</p>
<pre><code>// Definition of reusable &quot;sub-schema&quot;
const locationSchema = new mongoose.Schema({
    country: {type: String, trim: true},
    region: {type: String, trim: true},
    city: {type: String, trim: true},
    notes: String,
    latitude: {type: Number},
    longitude: {type: Number}
}, {_id: false});
</code></pre>
<p>Which is then used, for example, to define the <code>birth</code> field:</p>
<pre><code>birth: {
    date: {type: dateSchema, validate: dateValidator},
    location: locationSchema,
    notes: String
},
</code></pre>
<p>I did not manage to find much information on this, other than that it is possible to define nested fields as <code>Map</code>s, but how would I apply constraints to the sub-fields? And how would I use &quot;sub-schemas&quot; in Grails?</p>
<hr />
<p><strong>UPDATE WITH SOLUTION</strong></p>
<p>I misunderstood the use of <code>embedded</code>. If you (like me) do not want to create tables/collections for embedded types, simply put the embedded class (like <code>Location</code> in my case) under <code>src/main/...</code> or define it in the same file as the domain class. This is stated in the documentation: <a href="http://docs.grails.org/3.1.1/ref/Domain%20Classes/embedded.html" rel="nofollow noreferrer">http://docs.grails.org/3.1.1/ref/Domain%20Classes/embedded.html</a></p>
<p>My final, simplified solution is then:</p>
<p><strong>grails-app/.../Person.groovy</strong></p>
<pre><code>class Person implements MongoEntity&lt;Testy&gt; {

    ObjectId id
    String s
    Location location

    static mapping = {
        collection &quot;person&quot;

    }

    static embedded = ['location']  // key part that was missing
}
</code></pre>
<p><strong>src/main/.../Location.groovy</strong></p>
<pre><code>package hegardt.backend.grails.model.person

import grails.validation.Validateable


class Location implements Validateable {

    String country
    String region
    String city
    String notes
    Double latitude
    Double longitude

    static constraints = {
        country nullable: true
        region nullable: true
        city nullable: true
        notes nullable: true
        latitude nullable: true
        longitude nullable: true
    }
}
</code></pre>
<p>Now I can send requests with JSON data, and the mapping and saving works correctly, as well as validation on my embedded types!</p>

