MongoDB Dedupe and Sort using Reduce<p>I'm using <code>Reduce</code> to create a joined <code>String</code> of <code>field</code>s from an <code>array</code>.</p>
<p>For example, let's say I have an <code>array</code> of <code>subdocuments</code> called <code>children</code> - and each <code>child</code> has a <code>name</code> <code>field</code>.</p>
<p>e.g</p>
<pre><code>[
   {name:&quot;Zak&quot;}, {name:&quot;Bob&quot;}, {name:&quot;Sharon&quot;}, {name:&quot;Zak&quot;}, {name:&quot;Cindy&quot;}, {name:&quot;Bob&quot;}, {name:&quot;Peter&quot;}
]
</code></pre>
<p>The <code>expression</code> below will give me a &quot;csv&quot; of <code>&quot;Zak, Bob, Sharon, Zak, Cindy, Bob, Peter, &quot;</code>;</p>
<p>(Yes - I know I can use <code>$cond</code> to detect the last iteration and remove the <code>trail</code>ing <code>&quot;, &quot;</code>.</p>
<pre><code>  uniqueCsv: {
   $reduce: {
     input: &quot;$children&quot;,
     initialValue: '',
     in: {
       $concat: [&quot;$$this.name&quot;, &quot;, &quot;, &quot;$$value&quot;]
     }
   }
  }
</code></pre>
<p>Is it possible to <code>dedupe</code> and <code>sort</code> with this <code>reduce</code> so that we can have</p>
<p><code>&quot;Bob, Cindy, Peter, Sharon, Zak&quot;</code> ?</p>
<p>Thanks!</p>

